def reward_func(observations: np.ndarray, is_success: bool, is_failure: bool) -> float:
    angle_front_end = observations[0]
    vel_x_front_end = observations[3]
    angular_vel_front_end = observations[5]

    reward = vel_x_front_end - abs(angle_front_end) * 10 - abs(angular_vel_front_end) * 5

    if is_success:
        reward += 100
    elif is_failure:
        reward -= 50

    return reward

def reward_func(observations: np.ndarray, is_success: bool, is_failure: bool) -> float:
    angle_front_end = observations[0]
    vel_x_front_end = observations[3]
    angular_vel_front_end = observations[5]

    reward = 1.0 * vel_x_front_end - 0.5 * abs(angle_front_end) - 0.2 * abs(angular_vel_front_end)

    if is_success:
        reward += 50
    elif is_failure:
        reward -= 20

    return reward
